Create Table Clientes
(
COD_CLIE Varchar2(10) NOT NULL,
VAL_APE1 Varchar2(30) NOT NULL,
VAL_APE2 Varchar2(30),
VAL_NOM1 Varchar2(30) NOT NULL,
VAL_NOM2 Varchar2(30),
COD_SEXO Char(1),
FEC_CREA Timestamp not null,
SAL_DEUD_ANTE Number not null,
FEC_NACI Date not null,
Constraint Clientes_PK PRIMARY KEY (COD_CLIE)
);

Create Table Pedidos
(
FEC_SOLI Date not null,
COD_PERI Varchar2(10) not null,	
VAL_NUME_SOLI Number not null,
FEC_FACT Date not null,
VAL_ORIG Varchar2(15),
COD_CLIE Varchar2(10) not null,
COD_REGI Varchar2(3) not null,
COD_ZONA Varchar2(5) not null,
COD_SECC CHAR(1) not null,
SAL_DEUD_ANTE Number not null,
VAL_MONT_ESTI Number,
VAL_MONT_SOLI Number,
VAL_ESTA_PEDI Varchar2(25),
MOT_RECH Varchar2(25),
VAL_MONT_FLET Number,
VAL_UNID_LBEL Number not null,
VAL_UNID_CYZO Number not null,
VAL_UNID_ESIK Number not null,
Constraint Pedidos_PK PRIMARY KEY (VAL_NUME_SOLI)
);

